description:
Fast ACID table style document nosql database engine. easily deploy on mobile, desktop and web applications. KeyValue KeyOnly tables and SQL Like query methods, thread safe with CRUD.

For C# Mono Xamarin ASP.NET Core .NET Mobile Cross Platform Windows Phone Silverlight

for DNXCore, add 'dependencies' and 'imports' to project.json
  "frameworks": {
    "netcoreapp1.0": {
      "dependencies": {
        "Microsoft.NETCore.App": {
          "type": "platform",
          "version": "1.0.1"
        },
        "iBoxDB":"2.9.1"
      },
      "imports": "dnxcore50"
    }
  }
